CREATE DEFINER = 'hieunv'@'%'
PROCEDURE Proc_UpdateEmployee (IN EmployeeId char(36), IN EmployeeCode varchar(20), IN FullName varchar(100), IN DateOfBirth date, IN Gender int, IN UnitId char(36), IN IdentityNumber varchar(25), IN IdentityDate date, IN IdentityPlace varchar(255), IN Position varchar(100), IN Address varchar(255), IN MobilePhone varchar(50), IN DesktopPhone varchar(50), IN Email varchar(100), IN BankAccount varchar(25), IN BankName varchar(255), IN BankBranch varchar(255), IN ModifiedBy varchar(100))
BEGIN
