  SET e.EmployeeCode = EmployeeCode,
      e.FullName = FullName,
      e.DateOfBirth = DateOfBirth,
      e.Gender = Gender,
      e.UnitId = UnitId,
      e.IdentityNumber = IdentityNumber,
      e.IdentityDate = IdentityDate,
      e.IdentityPlace = IdentityPlace,
      e.Position = Position,
      e.Address = Address,
      e.MobilePhone = MobilePhone,
      e.DesktopPhone = DesktopPhone,
      e.Email = Email,
      e.BankAccount = BankAccount,
      e.BankName = BankName,
      e.BankBranch = BankBranch,
      e.ModifiedDate = CURRENT_TIMESTAMP(),
      e.ModifiedBy = ModifiedBy
  WHERE e.EmployeeId = EmployeeId;
END
$$

