VIEW view_employees
AS
SELECT
  `e`.`EmployeeId` AS `EmployeeId`,
  `e`.`EmployeeCode` AS `EmployeeCode`,
  `e`.`FullName` AS `FullName`,
  `e`.`DateOfBirth` AS `DateOfBirth`,
  `e`.`Gender` AS `Gender`,
  `e`.`IdentityNumber` AS `IdentityNumber`,
  `e`.`IdentityDate` AS `IdentityDate`,
  `e`.`IdentityPlace` AS `IdentityPlace`,
  `e`.`Position` AS `Position`,
  `e`.`Address` AS `Address`,
  `e`.`MobilePhone` AS `MobilePhone`,
  `e`.`DesktopPhone` AS `DesktopPhone`,
  `e`.`Email` AS `Email`,
  `e`.`BankAccount` AS `BankAccount`,
  `e`.`BankName` AS `BankName`,
  `e`.`BankBranch` AS `BankBranch`,
  `e`.`CreatedDate` AS `CreatedDate`,
  `e`.`CreatedBy` AS `CreatedBy`,
  `e`.`ModifiedDate` AS `ModifiedDate`,
  `e`.`ModifiedBy` AS `ModifiedBy`,
  `u`.`UnitId` AS `UnitId`,
  `u`.`UnitName` AS `UnitName`
FROM (`employee` `e`
  LEFT JOIN `unit` `u`
    ON ((`e`.`UnitId` = `u`.`UnitId`)))
ORDER BY CAST(REPLACE(`e`.`EmployeeCode`, 'NV-', '') AS decimal(10, 0)) DESC;

