--
-- Create procedure `Proc_GetFilterPagingEmployees`
--
CREATE DEFINER = 'hieunv'@'%'
PROCEDURE Proc_GetFilterPagingEmployees (IN PageSize int, IN PageNumber int, IN SearchTerms varchar(100), OUT TotalRecord int)
BEGIN
  DECLARE StartIndex int DEFAULT 0;
  SET @SearchTerms = SearchTerms;
  DROP TEMPORARY TABLE IF EXISTS tmpTable;
  IF PageSize > 0 THEN
    CREATE TEMPORARY TABLE tmpTable AS (SELECT
        *
      FROM view_employees ve
      WHERE 1 = 1
      AND (
      (
      (
      ve.EmployeeCode LIKE CONCAT('%', @SearchTerms, '%')
      OR ve.FullName LIKE CONCAT('%', @SearchTerms, '%')
      OR ve.MobilePhone LIKE CONCAT('%', @SearchTerms, '%')
      OR ve.DesktopPhone LIKE CONCAT('%', @SearchTerms, '%')
      )
      AND @SearchTerms IS NOT NULL
      )
      OR @SearchTerms IS NULL
      ));

    SET TotalRecord = (SELECT
        COUNT(*)
      FROM tmpTable);

    SET StartIndex = (PageSize * (PageNumber - 1));

    SELECT
      *
    FROM tmpTable
    ORDER BY tmpTable.CreatedDate DESC LIMIT StartIndex, PageSize;

  END IF;
END
$$

